import React from "react";
import "../App.css";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import logo from "../images/hand-book-logo-illustration-art-background-43965136.webp";
// import { useNavigate } from "react-router-dom";
import Toaster from "react-hot-toast";
import {useFormik} from 'formik';

const Home = () => {
  // const navigate = useNavigate();

  // const NavigateToMainPage = () => {
  //   navigate("/allbooks");
  // };

  const formik = useFormik({
    initialValues: {
      email: "",
      password: ""
    },
    validateOnBlur: false,
    validateOnChange: false,
    onSubmit: async values => {
      console
    }
  })

  return (
    <div className="home">
      <img className="homeLogo" src={logo} alt="library logo" />
      <div className="homeFirstDiv">
        <p className="welcome">WELCOME - TO - LIBRARY</p>
        <p className="slok">I measure the progress of a community by the degree of progress which women have achieved... Dr. B  R Ambedkar</p>
        <form onSubmit={formik.handleSubmit}>
        <div className="homeFirstDiv_childFirstDiv">
          <div className="textfield">
            <TextField {...formik.getFieldProps('email')} fullWidth label="Email" id="fullWidth" />
          </div>
          <div className="textfield">
            <TextField
              {...formik.getFieldProps('password')}
              fullWidth
              label="Password"
              type="password"
              id="fullWidth"
            />
          </div>
        </div>
        <Button
          // onClick={NavigateToMainPage}
          type="submit"
          fullWidth
          className="btn_In"
          variant="contained"
        >
          Sign-In
        </Button>
        </form>
        <p className="or">Forgate Password ?</p>
      </div>
    </div>
  );
};

export default Home;
